Title: List of awards and nominations received by The Simpsons
The Simpsons is an American animated sitcom created by Matt Groening that premiered on December 17, 1989, on Fox Broadcasting Company (Fox). The series is a satirical depiction of the working class life, epitomized by the Simpson family, which consists of Homer, the oafish safety inspector at the nuclear power plant; his wife Marge, a homemaker; the family's children Bart, a mischievous prankster; Lisa, an intelligent and aspiring environmentalist; and Maggie, Bart's younger sister and baby of the family;
